INSERT INTO `posts` VALUES (1,1,'Premier post','http://localhost:3000/images/static/assets/uploads/img_url-1627334099348-background-image.png','Bienvenue à tous, vous pouvez à présent partager vos contenu sur ce réseau soical d\'entreprise','2021-07-26 21:14:06','2021-07-26 21:14:59'),(2,2,NULL,NULL,'Bonjour tout le monde, heureux de vous rejoindre','2021-07-26 21:15:21','2021-07-26 21:15:21'),(3,3,'Présentation','http://localhost:3000/images/static/assets/uploads/img_url-1627334241915-Landscape-Color.jpg','Bonjour tout le monde, je me présente, je m\'appel Cédric j\'ai 32ans et je travail ici en tant que développeur web, j\'ai aidé à la création de ce réseau','2021-07-26 21:17:21','2021-07-26 21:17:21'),(4,4,NULL,NULL,'Bonjour moi c\'est Delphine, je cherche mon stylo bleu, quelqu\'un l\'aurais vue ?','2021-07-26 21:18:25','2021-07-26 21:18:25'),(5,5,NULL,NULL,'Hello tout le monde, moi c\'est Eric, chargé d\'affaire du secteur 7. J\'ai beaucoup de travail je vais me déconnecté','2021-07-26 21:21:26','2021-07-26 21:21:26'),(6,6,NULL,'http://localhost:3000/images/static/assets/uploads/img_url-1627334565642-eso1644bsmall__w770.jpg','Bonjour tout le monde, ici je vais écrire un message assez long histoire d\'avoir un rendu assez cohérent, je ne sais pas encore se que e vais écrir mais je sais que je vais écrir, et d\'ailleur je suis entrain d\'écrire, ca y est je suis déja en manque d\'inspiration. Le but étant de vérifier que ma variable long fonctionne correctement, je pense que oui, étant donné que je l\'ai déja testé...','2021-07-26 21:22:45','2021-07-26 21:23:25'),(7,7,NULL,NULL,'Bonjour, ravis de rejoindre notre nouveau réseau','2021-07-26 21:25:17','2021-07-26 21:25:17'),(8,8,NULL,'http://localhost:3000/images/static/assets/uploads/img_url-1627334802519-image-artistique.jpg','Moi aussi je veux écrire un post, du coup je l\'écris, j\'espère que la modération ne va pas supprimer ce post pour espace utilisé inutilement','2021-07-26 21:26:42','2021-07-26 21:26:42'),(9,9,NULL,NULL,'Hello, petit message de bienvenue','2021-07-26 21:28:18','2021-07-26 21:28:18'),(10,10,NULL,'http://localhost:3000/images/static/assets/uploads/img_url-1627334993282-Landscape-Color.jpg','Bonjour tout le monde, heureux de rejoindre notre nouveau réseau et de partager du contenu interessant','2021-07-26 21:29:53','2021-07-26 21:29:53'),(11,10,NULL,NULL,'Je rajoute un post histoire d\'afficher 3 pages dans la pagination','2021-07-26 21:30:36','2021-07-26 21:30:36');
